import React from 'react';
import img from "./common.jpeg";

function Common(props) {
    alert(props.img); 
    return (
        <>
            <img src={props.img}></img>
            <h1>Welcome. {props.pageName}!</h1>
            <p>{props.description}</p>
        </>  
    );
}

export default Common;
